create table links
(
    id              bigserial
        primary key,
    url             varchar(500) not null
        constraint links_url_unique
            unique,
    title           varchar(500) not null,
    icon            varchar(2000),
    added_at        timestamp(0),
    content_type_id bigint
        constraint links_content_type_id_foreign
            references content_types
            on delete restrict,
    domain_id       bigint
        constraint links_domain_id_foreign
            references domains
            on delete restrict,
    created_at      timestamp(0),
    updated_at      timestamp(0)
);

alter table links
    owner to postgresql_db_user;

